import React, { Component } from 'react'

export default class TodoList extends Component {
    constructor(props) {
        super(props)
        this.state = {
            todo_description: '',
            todo_responsible: '',
            todo_priority: '',
            todo_completed: false
        }
    }

    render() {
        return (
            <div>
                <p>Welcome to Todo List Component</p>
            </div>
        )
    }
}
